datastream = ""

datastream[:100]

for char in range(3, len(datastream)):
    letter = datastream[char]

    letters_before = [datastream[char - 3], datastream[char - 2], datastream[char - 1]]

    letters_before.append(letter)

    is_unique = True

    for elem in letters_before:
        if letters_before.count(elem) > 1:
            is_unique = False
    
    if is_unique == True:
        print(letters_before)
        print(char + 1)

